import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 10.1-2133 Annual report by State Comptroller.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/10.1-2133.md","filePath":"vacode/10.1-2133.md"}'),o={name:"vacode/10.1-2133.md"},n=r('<h1 id="§-10-1-2133-annual-report-by-state-comptroller" tabindex="-1">§ 10.1-2133 Annual report by State Comptroller. <a class="header-anchor" href="#§-10-1-2133-annual-report-by-state-comptroller" aria-label="Permalink to &quot;§ 10.1-2133 Annual report by State Comptroller.&quot;">​</a></h1><p>The State Comptroller shall, by January 1 of each year, certify to the chairmen of the House Committee on Appropriations and the Senate Committee on Finance and Appropriations, the total amount of annual general fund revenue collections in excess of the official estimate in the general appropriation act, the total amount of the unrestricted and uncommitted general fund balance whose reappropriation is not required in the general appropriation act at the close of the previous fiscal year and the total amount of funds that are to be directed to the credit of the Virginia Water Quality Improvement Fund under this article unless otherwise provided in the general appropriation act.</p><p>1997, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0021" target="_blank" rel="noreferrer">21</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0625" target="_blank" rel="noreferrer">625</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0626" target="_blank" rel="noreferrer">626</a>; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0684" target="_blank" rel="noreferrer">684</a>.</p>',3),i=[n];function l(p,c,s,h,d,f){return t(),a("div",null,i)}const m=e(o,[["render",l]]);export{_ as __pageData,m as default};
